import React, { useEffect, useState } from "react";
import { PageHeader, Form, Input, Button, List, Card, message, Modal } from "antd";
import { useAuth } from "../context/AuthContext";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const API = "http://localhost:3001";

export default function UploadMaterial() {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [materials, setMaterials] = useState([]);
  const [form] = Form.useForm();

  useEffect(() => {
    if (!user || user.role !== "teacher") navigate("/login");
    else loadData();
  }, [user, navigate]);

  const loadData = async () => {
    try {
      const res = await axios.get(`${API}/materials`);
      setMaterials(res.data);
    } catch {
      message.error("Lỗi không thể tải tài liệu");
    }
  };

  const onFinish = async (values) => {
    const nextId = materials.length ? Math.max(...materials.map(m => m.id)) + 1 : 1;
    const newMaterial = { id: nextId, ...values };
    try {
      await axios.post(`${API}/materials`, newMaterial);
      setMaterials(prev => [...prev, newMaterial]);
      form.resetFields();
      message.success("Tải lên thành công");
    } catch {
      message.error("Tải lên thất bại");
    }
  };

  const confirmDelete = (id) => {
    Modal.confirm({
      title: "Xác nhận xoá tài liệu?",
      onOk: async () => {
        try {
          await axios.delete(`${API}/materials/${id}`);
          setMaterials(prev => prev.filter(m => m.id !== id));
          message.success("Xoá thành công");
        } catch {
          message.error("Xoá thất bại");
        }
      }
    });
  };

  return (
    <div style={{ maxWidth: 800, margin: "0 auto", padding: 24 }}>
      <PageHeader title="Tải tài liệu lên" />
      <Form form={form} layout="vertical" onFinish={onFinish} style={{ marginBottom: 24 }}>
        <Form.Item
          label="Tiêu đề"
          name="title"
          rules={[{ required: true, message: "Vui lòng nhập tiêu đề" }]}
        >
          <Input placeholder="Tiêu đề tài liệu" />
        </Form.Item>
        <Form.Item
          label="Mô tả"
          name="description"
          rules={[{ required: true, message: "Vui lòng nhập mô tả" }]}
        >
          <Input.TextArea rows={3} placeholder="Mô tả ngắn" />
        </Form.Item>
        <Form.Item
          label="Link tài liệu"
          name="link"
          rules={[
            { required: true, message: "Vui lòng nhập link" },
            { type: 'url', message: "Link không hợp lệ" }
          ]}
        >
          <Input placeholder="https://..." />
        </Form.Item>
        <Form.Item>
          <Button type="primary" htmlType="submit">
            Tải lên
          </Button>
        </Form.Item>
      </Form>

      <List
        grid={{ gutter: 16, column: 1 }}
        dataSource={materials}
        renderItem={item => (
          <List.Item>
            <Card
              title={item.title}
              extra={
                <Button danger onClick={() => confirmDelete(item.id)}>
                  Xoá
                </Button>
              }
            >
              <p>{item.description}</p>
              <a href={item.link} target="_blank" rel="noreferrer">Xem tài liệu</a>
            </Card>
          </List.Item>
        )}
      />
    </div>
  );
}
